    # –ß–∏—Ç–∞–µ–º —Ä–∞–∑–º–µ—Ä—ã –∏–∑ stdin –∏–ª–∏ —Ñ–∞–π–ª–∞
    if args.file:
        with open(args.file) as f:
            sizes = [int(line.strip()) for line in f if line.strip().isdigit()]
